import React from 'react'
import styled from 'styled-components'

const Graph_styled = styled.div`
    // position: inherit;
    border: 1px solid white;
    border-radius: 25%;
    width: 100%;
    // height: 100%;
    color: ${(props) => props.theme.textColor}
`
const graph = (props) => {
    return (
        <Graph_styled>
            {props.children}
        </Graph_styled>
    )
}  
export default graph
